    return (
        <>
            {results.map(element => (
                <div key={element.id}>
                    {element.images.length ? <img width={"10%"} src={element.images[0].url} alt="" /> : <div>No Image</div>}
                    {element.name}
                </div>
            ))}
        </>

    );
}
